description:
"E-auksion" электрон савдо платформасининг янги такомиллаштирилган мобил иловасида қуйидаги ўзгартиришлар киритилди:

- мобил илованинг янги такомиллаштирилган асосий саҳифа кўриниши;

- кенгайтирилган қидирув, саралаш ва категориялар бўйича мол-мулклар, объектларни тез топиш ва кўриш;

- лот маълумотлари билан танишишда ўзгача, ёрқин дизайн;

- илованинг ишлаш тезкорлиги оширилди;

- аукцион савдоларида иштирок этишда қулай интерфейс.
